import '../../css/Dashboard';

class Dashboard extends Component {

    render() {
        return (
            <div>
                <Header></Header>
                <div>

                    <div className="menu">

                    </div>




                </div>

            </div>
        )
    };
}

export default withRouter(Dashboard);
